import SideBar from "../Sidebar/sideBar";
// import Input from "../UI/Input/Input";
import classes from "./Deshboard.module.css";

export default function Dashboard() {
  return (
    <Fragment>
      <div className={classes.dashboard}>
        <h1>Dashboard</h1>
        {/* <span>39 People</span> */}
        {/* <Input /> */}
      </div>
      <SideBar />
    </Fragment>
  );
}
